import React from 'react'
import { Player } from 'video-react';
import "node_modules/video-react/dist/video-react.css";
import videosrc from '../../video/demo.mp4/demo.mp4/'

export default class Video extends React.Component {
  render() {
    return (
      <div className='Video'>
        <Player ref="player" videoId="video-1" fluid='false' width='375px' height='211px'>
          <source src={videosrc} />
        </Player>
      </div>
    )
  }
}
